[{"location":"","page":"Home","title":"Home","text":"CurrentModule = LowRankIntegrators","category":"page"},{"location":"#LowRankIntegrators","page":"Home","title":"LowRankIntegrators","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for LowRankIntegrators.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [LowRankIntegrators]","category":"page"},{"location":"#LowRankIntegrators.DLRIntegrator","page":"Home","title":"LowRankIntegrators.DLRIntegrator","text":"Integrator computing solution to a dynamic low rank approximation problem\n\n\n\n\n\n","category":"type"},{"location":"#LowRankIntegrators.DLRSolution","page":"Home","title":"LowRankIntegrators.DLRSolution","text":"Solution object that tracks the evolution of a low rank approximation\n\n\n\n\n\n","category":"type"},{"location":"#LowRankIntegrators.LowRankApproximation","page":"Home","title":"LowRankIntegrators.LowRankApproximation","text":"\n\n\n\n","category":"type"},{"location":"#LowRankIntegrators.MatrixDEProblem","page":"Home","title":"LowRankIntegrators.MatrixDEProblem","text":"Problem of approximating the solution of a matrix differential equation\ndy/dt = f(t,y) with y(0) = y₀ on [t0,tf] with a low rank factorization \ny(t) ≈ u(t) = U(t)S(t)V(t)' where U(t) and V(t) are orthonormal bases approximating \nrange and co-range of y(t).\n\n\n\n\n\n","category":"type"},{"location":"#LowRankIntegrators.MatrixDataProblem","page":"Home","title":"LowRankIntegrators.MatrixDataProblem","text":"Problem of tracking the low rank decomposition u(t) = U(t)S(t) V(t)' of a \ntime-dependent (or streamed) matrix y(t) with t ∈ [t_0, t_f].\n\n\n\n\n\n","category":"type"},{"location":"#LowRankIntegrators.SVDLikeApproximation","page":"Home","title":"LowRankIntegrators.SVDLikeApproximation","text":"The factors of an SVD like approximation are an orthogonal matrix U which represents the range of the matrix,\nan orthogonal matrix V which represents the co-range of the matrix and a square core-matrix S which reprepresents\nthe map from the co-range to the range. To recover the full matrix one only needs to take the product U*S*V'.\n\n\n\n\n\n","category":"type"},{"location":"#LowRankIntegrators.solve-Tuple{LowRankIntegrators.AbstractDLRProblem, LowRankIntegrators.AbstractDLRAlgorithm, Any}","page":"Home","title":"LowRankIntegrators.solve","text":"solves the given problem with the specified algorithm and step size\n\n\n\n\n\n","category":"method"}]
